import React, { useState, createContext } from "react";

export const PlacesContext = createContext();

export const PetPlacesProvider = (props) => {
  const [places, setPlaces] = useState([
    {
      title: "Pet Place",
      address: "Pet Place Address #1",
      lon: "334567",
      lat: "34563",
      openTime: "3:30",
      closeTime: "4:00",
      postal: "54000",
      category: "34563",
      phone: "3:30",
      fb: "4:00",
      insta: "54000",
      twitter: "3:30",
      email: "4:00",
      url: "54000",
    },
  ]);
  const [addNew, setAddNew] = useState(false);

  const [columns, setColumns] = useState([
    {
      title: "Title",
    },
    {
      title: "Address",
    },
    {
      title: "Longitude",
    },
    {
      title: "Latitude",
    },
    {
      title: "Open Time",
    },
    {
      title: "Close Time",
    },
    {
      title: "Postal Code",
    },
    {
      title: "Category",
    },
    {
      title: "Phone",
    },
    {
      title: "Facebook Link",
    },
    {
      title: "Instagram Link",
    },
    {
      title: "Twitter Link",
    },
    {
      title: "Email",
    },
    {
      title: "URL",
    },
    {
      title: "Action",
    },
  ]);

  return (
    <PlacesContext.Provider
      value={{
        places: [places, setPlaces],
        addNew: [addNew, setAddNew],
        columns: [columns, setColumns],
      }}
    >
      {props.children}
    </PlacesContext.Provider>
  );
};
